import classes from './MyModalNavigation.module.css';

const MyModalNavigation = ({ visible, setVisible }) => {
  const rootClasses = [classes.myModalNavigation];

  if (visible) {
    rootClasses.push(classes.active);
  }

  return (
    <div className={rootClasses.join(' ')} onClick={() => setVisible(false)}>
      Lorem ipsum dolor sit amet consectetur adipisicing elit. Vel nemo rerum, iure maxime ipsa voluptas soluta quas! Perspiciatis in necessitatibus, dicta dignissimos facilis temporibus quaerat! Porro dolorem voluptatem ratione dolor!
    </div>
  );
};

export default MyModalNavigation;
